import styled from "styled-components";

export const Wrapper = styled.div`
background: linear-gradient(180deg, rgba(255,156,135,1) 0%, rgba(250,109,79,1) 0%, rgba(3,1,0,1) 100%);
width: 100vw;
padding: 40px;
`;

export const Content = styled.div`
display: flex;
width: 200px;
height: 200px;
`;

export const ImageWrapper = styled.div`
display: flex;
width: 200px;
height: 200px;
`;

export const Image = styled.img`
width: 100%;
height: 100%;
border-radius: 50%;
object-fit: cover;

`;
